import './App.css';
import './Navbar'
import './About'
import './Intro'
import Navbar from './Navbar';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <body>
        <Navbar/>
        <Intro/>
        <About/>
      </body>
    </div>
  );
}

export default App;
